import React from "react";
import Image from "./Image"
import './Gallery.css';
import {Row, Col} from 'antd';
  
class Gallery extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
      text: "Welcome to gallery!",
      imagesList: []
    };
  }
  
  async componentDidMount() {
    let response = await fetch('http://localhost:8000/api/images');
    response = await response.json();
    this.setState({
      imagesList: response.images
    });
    console.log(this.state.imagesList)
  }
  
  render() {
    return <div>
            <h1>{this.state.text}</h1>
            <Row className='gallery-container'>
              {this.state.imagesList.map(image =>{
                <Image key={image._id} image={image}/>
              })}
              
              {/* <Image url={'https://images.unsplash.com/photo-1626777697253-50d9b0b686f5?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80'}/>
              <Image url={'https://images.unsplash.com/photo-1626777697253-50d9b0b686f5?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80'}/>
              <Image url={'https://images.unsplash.com/photo-1626777697253-50d9b0b686f5?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80'}/> */}
            </Row>
          </div>
  }
}
  
export default Gallery;
